import React from "react";
import Navlinks from "./Navlinks";

function Navbar (props) {
    return(
        <nav className="navbar bg-dark mb-5">
            <div className="container">

                <img src="images/SHARP-logo-white.svg" style={{maxWidth: "175px", paddingTop: "0px", color: "red"}} />

                <ul className="navbar-nav">
                    <Navlinks hrefName="https://www.google.com" linkName="Invoices" />
                    <Navlinks hrefName="payments" linkName="Payments" />
                    <Navlinks hrefName="linkedin.com" linkName="Financial Reports" />
                </ul>
            </div>
        </nav>
    )
}

export default Navbar;
